import React from 'react';
import styled from 'styled-components';

const Header = () => (
  <header className='home-header'>
    <h2>Inc. This Morning</h2>
    <h1>
      <span>“</span> Blog <span>”</span>
    </h1>
    <p>
      awesome place to make oneself <br /> productive and entertained through
      daily updates.
    </p>
  </header>
);

export default styled(Header)`
  .home-header {
  text-align: center;
}

.home-header h2 {
  color: #0080ff;
  font-size: 2rem;
}

.home-header h1 {
  font-size: 3rem;
  color: #0f52ba;
  margin-bottom: 1rem;
}

.home-header h1 span {
  color: #b0c4de;
}

.home-header p {
  color: #a9a9a9;
  font-weight: 500;
}

`;
